    var CANVAS_SIZE = 64;
    var PIXEL_SIZE = 1;
    var SPACING = 0.5;
    var UP_OFFSET = 70;
    var RIGHT_OFFSET = -25;
    var DISTANCE = 50;
    var pixels = [];

    var drawCanvas = function() {
        var front = Vec3.normalize(Quat.getFront(MyAvatar.orientation));
        var up = Vec3.normalize(Quat.getUp(MyAvatar.orientation));
        var right = Vec3.normalize(Quat.getRight(MyAvatar.orientation));
        var pos = Vec3.sum(Vec3.multiply(DISTANCE,front), MyAvatar.position);
        pos = Vec3.sum(Vec3.multiply(up,UP_OFFSET),pos);
        pos = Vec3.sum(Vec3.multiply(right,RIGHT_OFFSET), pos);
        var posIncrementX = Vec3.multiply(SPACING, right);
        var posIncrementY = Vec3.multiply(-SPACING, up);
        var i, j;
        var ptr = 0;
        for (i = 0; i < CANVAS_SIZE; i++) {
            // inner loop draws a row of pixel
            for (j = 0; j < CANVAS_SIZE; j++) {
                var r = img[ptr];
                var g = img[ptr+1];
                var b = img[ptr+2];
                if (r+g+b > 0) {
                    drawPixel(r, g, b, pos);
                }
                ptr = ptr + 4;
                pos = Vec3.sum(pos, posIncrementX);
            };
            // reset to leftmost of canvas
            pos = Vec3.sum(pos, Vec3.multiply(-j,posIncrementX));
            // goes on to next row
            pos = Vec3.sum(pos, posIncrementY);
        }
    };

    var drawPixel = function(r,g,b,pos) {
        print("draw pixel");
        var props = {
            name: "pixel",
            type: "Sphere",
            dimensions: {x: PIXEL_SIZE, y: PIXEL_SIZE, z: PIXEL_SIZE},
            color: {red: r, green: g, blue: b},
            position: pos
        };
        pixels.push(Entities.addEntity(props));
    };

    print("running pixel art main: drawing easter");
    drawCanvas();
    
    function cleanup() {
        print("cleaning up pixel art");
        pixels.forEach(function(pixel){
            Entities.deleteEntity(pixel);
        });
    };
    Script.scriptEnding.connect(cleanup);
